   - **Self-interest**: Participants are motivated by the absolute amount they stand to gain (split_self).
   - **Fairness**: Participants consider the fairness of the offer, which can be represented by the difference between the proposed share percentage and an equal split (50%).

2. **Interaction of Mechanisms**:
   - Self-interest and fairness are combined to determine the overall utility of accepting an offer. A participant might accept an offer that is slightly unfair if the absolute gain is high, or reject a fair offer if the absolute gain is too low.

3. **Mathematical Form**:
   - A linear combination of self-interest and fairness can capture these interactions. The utility of accepting an offer can be modeled as a weighted sum of the absolute gain and the fairness of the offer.

4. **Parameters Needed**:
   - **alpha**: Weight for the absolute gain (split_self).
   - **beta**: Weight for the fairness consideration (split_perc_self - 50).

5. **Mapping to Observable Behavior**:
   - The utility of accepting an offer will be higher for offers that are both high in absolute gain and fair. Negative utility values will indicate unfavorable offers, leading to a higher likelihood of rejection.

